import React, { useEffect } from 'react';
import { Switch, Redirect, Route } from 'react-router-dom';


import LogInForm from './component/auth/LogInForm/LogInForm';
import Error404 from './screens/Error404Screen';
import LoginScreen from './screens/LoginScreen';
import SignUpScreen from './screens/SignUpScreen';
import HomeScreen from './screens/Home/HomeScreen';

function App() {

  return (
    <div className="App">
      <Switch>
        <Route exact path="/" render={() => {
          localStorage.getItem('authToken') ? (<Redirect to="/user/dashboard" />) : (<LoginScreen />)
        }} />
        <Route exact path="/user/dashboard" component={HomeScreen} />
        <Route exact path="/accounts/signup" render={() => <SignUpScreen />} />
        <Route component={Error404} />
      </Switch>


    </div>
  );
}

export default App;
